import {
  init_esm_shims
} from "./chunk-WWCIODDN.js";

// Modals/CustomEmbed/ce_color.ts
init_esm_shims();
var ce_color_default = {
  id: "ce_color",
  async execute(interaction) {
    const code = interaction.fields.getTextInputValue("code");
    const embed = interaction.message.embeds[0];
    if (!/^#[0-9A-F]{6}$/i.test(code)) return interaction.reply({ content: "Das ist kein g\xFCltiger Hex Color Code!", ephemeral: true });
    embed.data.color = parseInt(code.replace("#", "0x"));
    interaction.reply({ content: "Die Farbe wurde erfolgreich ge\xE4ndert", ephemeral: true });
    await interaction.message.edit({ embeds: [embed] });
  }
};
export {
  ce_color_default as default
};
